"use strict";

var winnersBtn = document.querySelector('.winners-btn');
var closeBtn = document.querySelector('.winners__closeBtn');
var winners = document.querySelector('.results__winners');
winnersBtn.addEventListener('click', function () {
  winners.classList.add('winners-active');
});
closeBtn.addEventListener('click', function () {
  winners.classList.remove('winners-active');
});
